import * as React from "react";
import { DataGrid } from "@mui/x-data-grid";
import { Container } from "@mui/material";
import { useState, useEffect } from "react";
const columns = [
  { field: "title", headerName: "Title", width: 110 },
  {
    field: "price",
    headerName: "Price",
    type: "numeric",
  },
  {
    field: "offer-price",
    headerName: "Offer-Price",
    type: "number",
  },
  { field: "photo", headerName: "Photo", width: 130 },
  { field: "status", headerName: "Status", width: 110 },
  { field: "created_at", headerName: "Created-At", width: 130 },
];
export default function DataTable() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    return fetch("https://groceryshop-api.herokuapp.com/api/product").then((req) => {
      req.json().then((result) => {
        setData(result.data);
      });
    });
  };

  console.log(data);
  return (
    <div>
      <Container style={{ height: 800, width: "100%" }}>
        <DataGrid
          rows={data}
          columns={columns}
          pageSize={5}
          rowsPerPageOptions={[5]}
          checkboxSelection
        />
        <div>
          <ul>
            {data.map((item) => {
              return <li key={item._id}>{item.title}</li>;
            })}
          </ul>
        </div>
      </Container>
    </div>
  );
}
